import React, { useState } from 'react';
import DataWithAll from './DataWithAll';


const OurPlans = () =>{
    
const card = (val) =>{
    return(
        <>
       
            <h1>{val.title}</h1>
            <p className="p1">{val.treks}<sub>Treks</sub></p>
            <p className="p2">{val.days}<sub>D/N</sub></p>
            <button>Apply Now</button>
        </>
    )
}


return(
<>

<div className="plan">
    <div>
<h3>See Our Plans</h3>
</div>
<div className="card" style={{backgroundImage:`url(${val.reference})` , backgroundSize:'cover'}}>
{
    DataWithAll.map(card)
}
</div>
</div>

</> 
      )
}

export default OurPlans;
